import { title } from "assets/jss/material-kit-react.js";

const productStyle = {
  section: {
    textAlign: "center",
    padding: "20px 0 20px"
  },
  title: {
    ...title,
    marginBottom: "1rem",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none"
  },
  description: {
    color: "#222222",
    fontSize: "1.3rem"
  },
  questionBox: {
    textAlign: "center",
    margin: "0px 03 0px"
  }
};

export default productStyle;
